/****** Object:  UserDefinedFunction [dbo].[ID_CN]    Script Date: 04/12/2021 3:25:33 CH ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[ID_CN]()
RETURNS VARCHAR(5)
AS
BEGIN
	DECLARE @ID VARCHAR(5)
	IF (SELECT COUNT(MACN) FROM CHINHANH) = 0
		SET @ID = '0'
	ELSE
		SELECT @ID = MAX(RIGHT(MACN, 3)) FROM CHINHANH
		SELECT @ID = CASE
			WHEN @ID >= 0 and @ID < 9 THEN 'CN00' + CONVERT(CHAR, CONVERT(INT, @ID) + 1)
			WHEN @ID >= 9 AND @ID < 99 THEN 'CN0' + CONVERT(CHAR, CONVERT(INT, @ID) + 1)
			WHEN @ID >= 99 THEN 'CN' + CONVERT(CHAR, CONVERT(INT, @ID) + 1)
		END
	RETURN @ID
END
GO
