/****** Object:  Trigger [dbo].[CapNhatHang]    Script Date: 04/12/2021 3:25:34 CH ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE TRIGGER [dbo].[CapNhatHang] 
ON [dbo].[CTDONHANG] 
FOR UPDATE
AS 
BEGIN
	DECLARE @SLCN INT, @SLTON INT, @SLDEL INT
	SET @SLCN = (SELECT SLSANPHAM FROM inserted)
	SET @SLTON = (SELECT SLTON FROM SANPHAM, inserted WHERE SANPHAM.MASP = inserted.MASP)
	SET @SLDEL = (SELECT SLSANPHAM FROM deleted)
	IF (@SLCN - @SLDEL > @SLTON)
	BEGIN
		PRINT N'Số lượng CẬP NHẬT vượt quá số lượng sản phẩm hiện có.'
		ROLLBACK TRAN
	END
	UPDATE SANPHAM
	SET SLTON = SLTON + 
	(SELECT SLSANPHAM FROM deleted D WHERE D.MASP = SP.MASP) - 
	(SELECT SLSANPHAM FROM inserted I WHERE I.MASP = SP.MASP)
	FROM SANPHAM SP JOIN deleted ON SP.MASP = deleted.MASP
END
GO
ALTER TABLE [dbo].[CTDONHANG] ENABLE TRIGGER [CapNhatHang]
GO
