CREATE TRIGGER [dbo].[DatHang] 
ON [dbo].[CTDONHANG] 
FOR INSERT
AS 
BEGIN
	DECLARE @SLDAT INT, @SLTON INT
	SET @SLDAT = (SELECT SLSANPHAM FROM inserted)
	SET @SLTON = (SELECT SLTON FROM SANPHAM, inserted WHERE SANPHAM.MASP = inserted.MASP)
	IF (@SLDAT > @SLTON)
	BEGIN
		PRINT N'Số lượng đặt vượt quá số lượng sản phẩm hiện có.'
		ROLLBACK TRAN
	END
	UPDATE SANPHAM
	SET SLTON = SLTON - (
		SELECT SLSANPHAM
		FROM inserted I
		WHERE I.MASP = SP.MASP
	)
	FROM SANPHAM SP JOIN inserted ON SP.MASP = inserted.MASP
END
GO
ALTER TABLE [dbo].[CTDONHANG] ENABLE TRIGGER [DatHang]
GO
