CREATE TRIGGER [dbo].[TONGTIEN_DH]
ON [dbo].[CTDONHANG]
FOR INSERT, UPDATE
AS
	BEGIN
		UPDATE DONHANG 
		SET TONGTIEN = DH.PHIVC + (SELECT SUM(CT.THANHTIEN) FROM CTDONHANG CT WHERE CT.MADH = I.MADH GROUP BY CT.MADH)
		FROM inserted I, DONHANG DH
		WHERE DH.MADH = I.MADH
	END
GO
