CREATE TRIGGER [dbo].[TT_CTDH]
ON [dbo].[CTDONHANG]
FOR INSERT, UPDATE
AS
	BEGIN
		UPDATE CTDONHANG 
		SET THANHTIEN = I.SLSANPHAM * (SELECT DONGIA FROM SANPHAM SP WHERE SP.MASP = I.MASP) 
		FROM inserted I, CTDONHANG CT
		WHERE CT.MADH = I.MADH AND I.MASP = CT.MASP
	END
GO
